    return(
        <div>
            <div id="bntw-ticket" onMouseEnter={() => setIsShown(true)} onMouseLeave={() => setIsShown(false)}>
                <h4>{parseArtistNames()}</h4>
                <h4>{parseSongTitle()}</h4>
            </div>
        </div>
    )
}

export default BntwAssetCardFront
